import axios from "axios";
import React, { useEffect, useState } from 'react';
import { useHistory } from 'react-router-dom';
import api from '../service/api';

export default function Home() {
  const [selectedBreed, setSelectedBreed] = useState('');
  const [selectedBreedImage, setSelectedBreedImage] = useState(null);
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    color: '',
    size: ''
  });

  const history = useHistory();

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await api.get('breeds/list/all');
        if (response) {
          setSelectedBreed(Object.keys(response.data.message)[0]);
          handleBreedChange(Object.keys(response.data.message)[0]);
        } else {
          console.error('Erro ao buscar dados das raças: Resposta vazia ou inválida');
        }
      } catch (error) {
        console.error('Erro ao buscar dados das raças:', error);
      }
    };

    fetchData();
  }, []);

  const handleBreedChange = async (breed) => {
    setSelectedBreed(breed);
    try {
      const response = await api.get(`breed/${breed}/images/random`);
      setSelectedBreedImage(response.data.message);
    } catch (error) {
      console.error('Erro ao buscar imagem da raça:', error);
    }
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    // Aqui você pode enviar os dados do formulário para o servidor
    console.log('Dados do formulário:', formData);
    // Exemplo de redirecionamento para uma rota específica
    history.push('/specific-route');
  };

  return (
    <div style={{ flex: 1, flexDirection: 'row'}}>
      <div style={{ width: '50%', height: 100,}}>
        <h2>Lista de Raças de Cachorro</h2>
        <select value={selectedBreed} onChange={(e) => handleBreedChange(e.target.value)}>
          {Object.keys(breeds).map((breed, index) => (
            <option key={index} value={breed}>
              {breed}
            </option>
          ))}
        </select>
      </div>
      <div style={{ width: '50%', height: 100,}}>
        {selectedBreedImage && (
          <div>
            <img width="300" height="200" src={selectedBreedImage} alt="Imagem da raça selecionada" />
            <form onSubmit={handleSubmit}>
              <label style={{ display: 'block' }}>
                Apelido:
                <input type="text" name="name" value={formData.name} onChange={handleInputChange} style={{ display: 'block' }} />
              </label>
              <label style={{ display: 'block' }}>
                Idade:
                <input type="text" name="age" value={formData.age} onChange={handleInputChange} style={{ display: 'block' }} />
              </label>
              <label style={{ display: 'block' }}>
                Cor:
                <input type="text" name="color" value={formData.color} onChange={handleInputChange} style={{ display: 'block' }} />
              </label>
              <label style={{ display: 'block' }}>
                Tamanho:
                <input type="text" name="size" value={formData.size} onChange={handleInputChange} style={{ display: 'block' }} />
              </label>
              <button type="submit">Enviar</button>
            </form>
          </div>
        )}
      </div>
      <div>
        {/* Aqui você pode adicionar qualquer outra informação relacionada à raça selecionada */}
      </div>
  </div>
  );
}
